import React from 'react';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
// import '../../node_modules/bootstrap/dist/js/bootstrap.bundle';
import '../css/app.css';

import LocationOnIcon from '@material-ui/icons/LocationOn';

const Temp_app = ()=>{
    return (
        <>
        <header>
        <section>
            <div className="container-fluid">
                <div className="row">
                    <h1 className=" col-lg-12 col-md-12 col-sm-12 text-center text-capitalize my-5 text-dark font-weight-bolder">Weather App</h1>
                </div>

            </div>
        </section>
        </header>

        <section>
            <article>
                
                
               
                <div className="container-fluid text-center col-lg-4 col-md-4 col-sm-11">
                
                    <div className="form-group ">
                    
                    <i ><LocationOnIcon/></i><input className="form-control text-center" type="search" placeholder="Your Location"/>
                    </div>

                </div>
            </article>

        </section>
        
        </>
    )

}

export default Temp_app
